import React, { Component } from 'react'
import MyNavLink from '../../../MyNavLink'
import './index.css'

export default class CartItem extends Component {
    render() {
        return (
            <div className='cart_item'>
                <div className='item_img'>
                    <img src="https://gimg2.baidu.com/image_search/src=http%3A%2F%2Fhomesitetask.zbjimg.com%2Fhomesite%2Ftask%2FQQ%E6%88%AA%E5%9B%BE20170605045135.jpg%2Forigine%2Fc7675075-a6d2-448f-9253-668bb99597a2&refer=http%3A%2F%2Fhomesitetask.zbjimg.com&app=2002&size=f9999,10000&q=a80&n=0&g=0n&fmt=jpeg?sec=1616507435&t=d12e057ffc2dc03d6678e212c26df086" alt="item_img"/>
                </div>
                CartItem
                <MyNavLink to='/product' state={{}} className='cart_item_name'></MyNavLink>

                <p className=''></p>

            </div>
        )
    }
}
